import React from 'react';

function FilterDetails({ price }) {
  if (price) {
    return (
      <>
        <div className="price-boxes">
          <div className="price__min">min</div>
          <div className="price__max">max</div>
        </div>
        <div className="price-range"></div>
      </>
    );
  }
}

export default FilterDetails;
